      $value: $value * $number; } }
  @else if $exp < 0 {
    @for $i from 1 through -$exp {
      $value: $value / $number; } }
  @return $value; }
@function fact($number) {
  $value: 1;
  @if $number > 0 {
    @for $i from 1 through $number {
      $value: $value * $i; } }
  @return $value; }
@function toFixed($number, $power) {
