  axiosInstance.get('api/config')
    .then((response) => {
      const config = response.data
      // console.log(locale, 'configAction')
      commit('configMutation', { config, locale })
    })
    .catch(error => {
      Notify.create({
        color: 'negative',
        position: 'top',
        message: 'configAction' + error,
        icon: 'report_problem'
      })
    })
}

