import { axiosInstance } from 'boot/axios'
import { Notify } from 'quasar'

export async function loginAction ({ commit, dispatch }, payload) {
  axiosInstance.post('api/users', payload)
    .then(response => {
      const token = response.data
      commit('loginMutation', token)
      dispatch('authAction')
      // Redirect home.
      this.$router.push({ path: '/' })
    })
    .catch(error => {
      Notify.create({
        color: 'negative',
        position: 'top',
        message: 'loginAction ' + error,
        icon: 'report_problem'
      })
    })
}

export async function registerAction ({ commit, dispatch }, payload) {
  axiosInstance.post('api/register', payload)
  dispatch('loginAction', payload)
    .then(response => {
      Notify.create({
        color: 'positive',
        position: 'top',
        message: 'Registration Successfull',
        icon: 'check'
      })
    })
    .catch(error => {
      Notify.create({
        color: 'negative',
        position: 'top',
        message: 'registerActionn ' + error,
        icon: 'report_problem'
      })
    })
}

export async function authAction (context) {
  let token = context.getters['tokenGetter']
  if (token) {
    try {
      const { data } = await axiosInstance.get('api/user')
      context.commit('authMutation', { user: data })
    } catch (error) {
      Notify.create({
        color: 'negative',
        position: 'top',
        message: 'authAction ' + error,
        icon: 'report_problem'
      })
    }
  }
}

export async function githubAuthAction (context, { provider }) {
  const { data } = await axiosInstance.post(`/api/login/${provider}`, {
    url: process.env.APP_URL // ToImplement
  })
  return data.url
}

export async function logoutAction ({ commit }, payload) {
  try {
    axiosInstance.post('api/users', payload)
  } catch (e) { }

  commit('logoutMutation')
}

export function authGetter (state) {
  return state.user
}

export function tokenGetter (state) {
  // console.log(state, 'authGetter')
  return state.token
}

import { Cookies, LocalStorage } from 'quasar'

export function loginMutation (state, token) {
  console.log(token.expires_in)
  state.token = token.access_token
  if (state.cookie) {
    Cookies.set('token', token.access_token, { expires: token.expires_in ? 365 : null })
  } else {
    // localStorage.setItem('token', token.access_token, { expires: token.expires_in ? 365 : null })
    LocalStorage.set('token', token.access_token, { expires: token.expires_in ? 365 : null })
  }
}

export function authMutation (state, { user }) {
  state.user = user
}

export function logoutMutation (state) {
  state.user = null
  state.token = null
  if (state.cookie) {
    Cookies.remove('token')
  } else {
    // localStorage.removeItem('token')
    LocalStorage.remove('token')
  }
}
